import * as Reset from './ResetFunctions.js'
import './Reset.css'
//import { FaFacebookF, FaTwitterSquare } from "react-icons/fa";
export default function ResetData() {

    

    const submitData=() => {
       
        // console.log(userData)
        Reset.resetdata()
            .then((response)=> {
            
               console.log(response.data);
               
                window.location.href='/Admin/reset'
                alert("reset Successfull");
            }).catch(function (error) {
            
                console.log(error.response);
                
                });
    }



    return (
        <div className="container">
            <section className="myform-area">
                <div className="container">
                    <div className="row justify-content-center">
                        <div className="col-lg-60">
                            <div className="form-area login-form">
                               
                                    
                                 
                                    {/* <ul>
                                        <li><a href="/#" className="facebook"><FaFacebookF /></a></li>
                                    </ul>
                                    <ul>
                                        <li><a href="/#" className="twitter"><FaTwitterSquare /></a></li>
                                    </ul> */}
                               
                                <div className="form-input">
                                  
                                  <form>
                                        <div class="myform-button">
                                            <button onclick={submitData()} type="submit"  className="myform-btn">Reset</button>
                                        </div>
                                        </form>
                                       
                                    
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>

        </div >
    )
}
